import React, { Children } from "react";
import { Menu, Input } from "antd";

const Layout = ({children}) => {
  return (
    <>
      <Menu>
        <Menu.Item key="home">SNS</Menu.Item>
        <Menu.Item key="profile">PROFILE</Menu.Item>
        <Menu.Item key="mail">
          <Input.Search enterButton/>
        </Menu.Item>
      </Menu>
      {children}
    </>
  );
};

export default Layout;
